// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
import "./xClaimHolder.sol";
import "./xKeyHolder.sol";

contract EthereumClaimsRegistry {
    event ClaimHolderAdded(address claimHolder);
    event CheckHash(bytes32 hash);
    mapping(address => xClaimHolder) public claimHolder;

    function addClaimHolder()
        public
        returns (address contractAddr, xClaimHolder)
    {
        xClaimHolder holder = new xClaimHolder();
        contractAddr = address(holder);
        claimHolder[contractAddr] = holder;
        emit ClaimHolderAdded(address(holder));
        emit CheckHash(keccak256(abi.encodePacked(holder)));
        emit CheckHash(keccak256(abi.encodePacked(contractAddr)));
        return (contractAddr, holder);
    }

    function getClaimHolder(address addr) public view returns (xClaimHolder) {
        return claimHolder[addr];
    }

    function addClaim(
        address holder,
        uint256 _claimType,
        uint256 _scheme,
        address _issuer,
        bytes memory _signature,
        bytes memory _data,
        string memory _uri
    ) public returns (bytes32 claimID) {
        return
            claimHolder[holder].addClaim(
                _claimType,
                _scheme,
                _issuer,
                _signature,
                _data,
                _uri
            );
    }

    function removeClaim(address holder, bytes32 _claimId) public {
        claimHolder[holder].removeClaim(_claimId);
    }

    function getClaim(address holder, bytes32 _claimId)
        public
        view
        returns (
            uint256 claimType,
            uint256 scheme,
            address issuer,
            bytes memory signature,
            bytes memory data,
            string memory uri
        )
    {
        return claimHolder[holder].getClaim(_claimId);
    }

    function getClaimIdsByType(address holder, uint256 _claimType)
        public
        view
        returns (bytes32[] memory claimIds)
    {
        return claimHolder[holder].getClaimIdsByType(_claimType);
    }

    function destroy(address holder) public {
        claimHolder[holder].destroy(payable(address(this)));
    }

    function addKey(
        address _holder,
        bytes32 _key,
        uint256 _purpose,
        uint256 _type
    ) public returns (bool success) {
        return claimHolder[_holder].addKey(_key, _purpose, _type);
    }

    function getKey(address _holder, bytes32 _key)
        public
        view
        returns (
            uint256 purpose,
            uint256 keyType,
            bytes32 key
        )
    {
        return claimHolder[_holder].getKey(_key);
    }

    function getKeyPurpose(address _holder, bytes32 _key)
        public
        view
        returns (uint256 purpose)
    {
        return claimHolder[_holder].getKeyPurpose(_key);
    }

    function getKeysByPurpose(address _holder, uint256 _purpose)
        public
        view
        returns (bytes32[] memory _keys)
    {
        return claimHolder[_holder].getKeysByPurpose(_purpose);
    }

    function removeKey(address _holder, bytes32 _key)
        public
        returns (bool success)
    {
        return claimHolder[_holder].removeKey(_key);
    }
}
